import React, { useState, useEffect } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
const SingleShips = () => {
  const { id } = useParams();
  useEffect(() => {
    axios.get(`https://api.spacexdata.com/v4/ships/${id}`);
  });
  return <div></div>;
};

export default SingleShips;
